import React from 'react'


import Styled from 'styled-components'

import {AiOutlineLogout} from 'react-icons/ai'
import {AiOutlineHome} from 'react-icons/ai'
const Sidebar=()=> { 
  return (
    <SidebarContainer>
        <Menu>
            <a >
                <DashboardIcon/>
                <span>Dashboard</span>
            </a>
            <a >
                <DashboardIcon/>
                <span>Clients</span>
            </a>
            <a >
                <DashboardIcon/>
                <span>Bodyguard</span>
            </a>
            <a >
                <DashboardIcon/>
                <span>Team</span>
            </a>
            <a >
                <DashboardIcon/>
                <span>Settings</span>
            </a>
            <a >
                <DashboardIcon/>
                <span>Notification</span>
            </a>
            
        </Menu>
        <Logout>
          <LogoutIcon/>
          <span>Logout</span>
        </Logout>

    </SidebarContainer>
  )
}

export default Sidebar;

const SidebarContainer = Styled.div`
    display:flex;
    flex-direction: column;
    justify-content: space-between;
    
    background:white;
    width:200px;
    top: 0;
    height: calc(100vh - 50px);
    left:0;
    bottom:0;
    position:relative;
    box-shadow: 0 0 10px rgba(0,0,0,.2);

    



`
const Menu = Styled.div`
display:flex;
justify-content:space-between;
align-items:start;
flex-direction:column;
margin-bottom: 2rem;
padding: 5px;
margin: 10px;

a{
  padding:10px;
  display:flex;
  align-items:center;
  justify-content:center;
}


`
const Logout = Styled.div`

bottom:0px !important;
font-weight:400;
margin-bottom:0;
position:absolute;
margin-left:3rem;
display:flex;
align-items: center;




`

const LogoutIcon = Styled(AiOutlineLogout)`
padding-right: 3px;
font-weight:bold;
font-size:20px;
`

const DashboardIcon= Styled(AiOutlineHome)`

`
